wikibasecirrus-license-mapping:
{{notranslate}}
Map of license names to structured data statements, for use with the haslicense keyword feature.  They must be specified as license-name|P123=Q456,P123=Q789. You can translate the text, including "Leave this line exactly as it is". Some lines of this messages have one (1) leading space. 

This message will be shown with left-to-right direction, so when you are translating to a right-to-left language, you may want to test how it looks in left-to-right and add right-to-left marks as needed.
